  false,\n\t\"url\": null,\n\t\"notes\": \"The Office of National Marine Sanctuaries
  manages a system of sanctuaries and other managed areas around the country. The
  legal boundaries of These sanctuaries are defined within the Code of Federal Regulations,
  at 15 C.F.R. Part 922 and thesubparts for each national marine sanctuary. The GIS
  compatible digital boundary files for each national marine sanctuary are representations
  of those legal boundaries and are based on the best available data. These files
  are available for public use at locations defined in this metadata record.\",\n\t\"owner_org\":
